import "./Hidden1.css";

export const Hidden1 = () => {
  return (
    <div className="hiddenContainer1">
      <div className="hiddenTop1">
        <span className="hiddenTitle1">Registrovanih korisnika</span>
        <img src="\img\Path 694.svg" alt="img" className="hiddenTopImg1" />
      </div>
      <img src="\img\Path 689.svg" alt="img" className="hiddenImg1" />
      <span className="hiddenSpan1">
        Dostupno u <span style={{ color: "#FEC478" }}>Business</span> verziji!
      </span>
      <img src="\img\Snimka zaslona (2).png" alt="img" className="blur1" />
    </div>
  );
};
